import "../styles/Card.css";
import { NavLink } from "react-router-dom";

function Card(props) {
	const titre = props.infos.name;
	const image = props.infos.image;
	console.log(image);
	const description = props.infos.description;
	const date = props.infos.date;
	const url = props.infos.url;

	return (
		<section class="card-container">
			<div class="card">
				<figure class="hexagon front">
					<div class="card-content">
						<h1>{titre}</h1>
					</div>
					<div class="hexagon-inset">
						<div class="card-content">
							<img src={image} alt="" />
						</div>
					</div>
					<span class="see-more">
						<i class="fa fa-repeat"></i>
					</span>
				</figure>
				<figure class="hexagon back">
					<div class="card-content"></div>
					<span class="see-more">
						<i class="fa fa-repeat"></i>
					</span>
				</figure>
			</div>
		</section>
	);
}

export default Card;
